import React from "react"; 
import logo from '../Images/logo.png';
import {NavLink} from 'react-router-dom';
import '../Css/Header.css';


const Header=()=>{
    return(
        <>
            <header className="container d-flex justify-content-center">
                
                    <div className="logo w-100">
                        <img src={logo} alt="aivys-logo" />
                    </div>

                    
                        <div>
                            <NavLink to="/" className="listItem mx-3" activeClassName="activeItem">Home</NavLink>
                            <NavLink to="/about" className="listItem mx-3" activeClassName="activeItem">About</NavLink>
                            <NavLink to="/couture" className="listItem mx-3" activeClassName="activeItem">Couture Process</NavLink>
                            <NavLink to="/store" className="listItem mx-3" activeClassName="activeItem">Store</NavLink>
                            <NavLink to="/contact" className="listItem" activeClassName="activeItem">Contact</NavLink>
                        </div>
                    

                    
                    <div>
                        <button><NavLink>Book a Consultation</NavLink></button>
                    </div>
                
            </header>
        </>
    )
}
export default Header;
